string s;
int n;
int dp[405][405][(1 << 4)][(1 << 4)];
int cost[256];
int pos[256];
void setconst() {
    for(char c = '1'; c <= '9'; c++) {
        cost[c] = c - '0';
    }
    pos['c'] = 0;
    pos['h'] = 1;
    pos['i'] = 2;
    pos['m'] = 3;
    pos['C'] = 0;
    pos['H'] = 1;
    pos['I'] = 2;
    pos['M'] = 3;
}
const int inf = 1e9;
void maxi(int &a, int b) {
    a = max(a, b);
}

int main() {
    setconst();
    cin >> s;
    n = s.size();
    for(int i = n - 1; i >= 0; i--) {
        for(int j = i; j < n; j++) {
            for(int mask1 = 0; mask1 < (1 << 4); mask1 ++) {
                for(int mask2 = 0; mask2 < (1 << 4); mask2++) {
                    dp[i][j][mask1][mask2] = -inf;
                    // choose left
                    if(cost[s[i]] or s[i] == '#') {
                        //normal card
                        maxi(dp[i][j][mask1][mask2], cost[s[i]] - dp[i + 1][j][mask2][mask1]);
                    } else if(isupper(s[i])) {
                        //unlock
                        maxi(dp[i][j][mask1][mask2], -dp[i + 1][j][mask2][mask1 | (1 << pos[s[i]])]);
                    } else if(mask1 >> pos[s[i]] & 1) {
                        //lock
                        maxi(dp[i][j][mask1][mask2], -dp[i + 1][j][mask2][mask1]);
                    }
                    // choose right
                    if(cost[s[j]] or s[j] == '#') {
                        //normal card
                        maxi(dp[i][j][mask1][mask2], cost[s[j]] - dp[i][j - 1][mask2][mask1]);
                    } else if(isupper(s[j])) {
                        //unlock
                        maxi(dp[i][j][mask1][mask2], -dp[i][j - 1][mask2][mask1 | (1 << pos[s[j]])]);
                    } else if(mask1 >> pos[s[j]] & 1) {
                        //lock
                        maxi(dp[i][j][mask1][mask2], -dp[i][j - 1][mask2][mask1]);
                    }
                    if(dp[i][j][mask1][mask2] == -inf) 
                    dp[i][j][mask1][mask2] = 0;
                }
            }
        }
    }
    int tmp = dp[0][n - 1][0][0];
    switch (tmp) {
        case 0:
            cout << "StarSapphire";
            break;
        default:
            if(tmp > 0) {
                cout << "LunaChild";
            } else {
                cout << "SunnyMilk";
            }
    }
    cout << '\n';

    
    cout << tmp;
}